import { useQuery, gql } from '@apollo/client';
import Developer from './Developer.js';

const FEED_QUERY=`
{
developer
{
id
name
surname
email
games
{
title
}
}
}`

export default function DeveloperList()
{
    const {data}=useQuery(FEED_QUERY)

    return (
        <div>
            {data && (
                <>
                {data.developer.map((developer)=>(<Developer/>))}
                </>
            )}
        </div>
    )
}
